    <div className='container'>
      <h1>Contact Us</h1>
      <p>
If you have any questions about this policy or your privacy while using Cookie Crumbs, feel free to reach out:
Email: support@cookiecrumbs.app</p>
    </div>
  );
}

export default ContactUs;
